import React from 'react';
import Button from "@mui/material/Button";
import Stack from "@mui/material/Stack";
import TextField from "@mui/material/TextField";
import Typography from "@mui/material/Typography";

import { useTheme } from "@mui/material/styles";

const Registerpage = () => {
    const theme = useTheme();
    const primaryColor = theme.palette.primary.main;
    const gray2 = theme.palette.gray2.main;

    return (
      <Stack
        spacing="60px"
        sx={{ width: "616px", margin: "0 auto", marginTop: "60px" }}
      >
        <Stack spacing={5} sx={{ textAlign: "left" }}>
          <Stack spacing={2}>
            <Typography
              variant="h5"
              component="h1"
              sx={{ color: primaryColor, fontWeight: "500" }}
            >
              Are you ready become a professional cheff?
            </Typography>
            <Typography paragraph={true} sx={{ color: gray2 }}>
              Please register first
            </Typography>
          </Stack>
          <Stack spacing={3}>
            <TextField type="name" label="Name" />
            <TextField type="email" label="Email" />
            <TextField type="password" label="Password" />
            <TextField type="password" label="Confirm Password" />
          </Stack>
          <Button
            variant="contained"
            color="secondary"
            sx={{
              width: "140px",
              alignSelf: "flex-end",
              borderRadius: "8px",
              color: primaryColor,
              textTransform: "none",
            }}
          >
            Sign Up
          </Button>
        </Stack>
        <Typography paragraph={true} sx={{}}>
          have account?{" "}
          <a href="#" style={{ textDecoration: "none" }}>
            Login here
          </a>
        </Typography>
      </Stack>
    );
  };

export default Registerpage
